import { Card } from './Card'

type TopicConstructorParams = {
  id: string
  name: string
  cards?: Card[]
}

class Topic {
  private id: string
  private name: string
  private cards: Card[]

  constructor({ id, name, cards = [] }: TopicConstructorParams) {
    this.id = id
    this.name = name
    this.cards = cards
  }
}

export { Topic }
